/**
 * 
 * @param idLangCombo
 * @param idLibTypeCombo
 * @param idLibCombo
 * @param idLibVerCombo
 * @param idResTypeCombo
 * @param idButton
 * @returns {ResourceCombos}
 */
ResourceCombos = function(idLangCombo, idLibTypeCombo, idLibCombo, idLibVerCombo, idResTypeCombo, idButton, exclude) {

	// ///////////////////////////////////////////////////////////////////
	// ATRIBUTTES
	// ///////////////////////////////////////////////////////////////////
	
	// Combo text values.
	
	var DEFAULT_VALUE_Loading = "Loading...";
	
	var DEFAULT_VALUE_Language = "Select language";
	
	var DEFAULT_VALUE_LibraryType = "Select component";
	
	var DEFAULT_VALUE_Library = "Select library";
	
	var DEFAULT_VALUE_LibraryVersion = "Select version";
	
	var DEFAULT_VALUE_ResourceType = "Select resource";
	
	// ///////////////////////////////////////////////////////////////////
	// CONSTRUCTOR
	// ///////////////////////////////////////////////////////////////////
	
	// Language combo ID.
	this.idLangCombo = idLangCombo;
	
	// Library type combo ID.
	this.idLibTypeCombo = idLibTypeCombo;
	
	// Library combo ID.
	this.idLibCombo = idLibCombo;
	
	// Library version combo ID.
	this.idLibVerCombo = idLibVerCombo;
	
	// Resource type combo ID.
	this.idResTypeCombo = idResTypeCombo;
	
	// Button ID.
	this.idButton = idButton;
	
	// Exclude CORE related libraries (Log Service)
	this.exclude = exclude;	
	
	//
	if (idButton != null) {
	
		// Set <A> over color.
		$('#' + idButton).mouseover(function() {
			$('#' + idButton).children('a').css({color: "white"});  
		});
		
		// Set <A> out color.
		$('#' + idButton).mouseout(function() {
			$('#' + idButton).children('a').css({color: TEXT_COLOR_Selected});  
		});	
	
		// Hide button.
		$('#' + idButton).hide();
	
	}
		
	// Initialize the combo.
	if (idLangCombo == null) {
		updateCombo(idLibTypeCombo, LIBRARY_TYPES, DEFAULT_VALUE_LibraryType);
		$("#" + idLibTypeCombo).css({cursor: "pointer"});
	} else {
		updateCombo(idLangCombo, LANGUAGES, DEFAULT_VALUE_Language);
		$("#" + idLangCombo).css({cursor: "pointer"});
		$("#" + idLibTypeCombo).attr('disabled', 'disabled');
	}
	
	//
	$("#" + idLibCombo).attr('disabled', 'disabled');
	$("#" + idLibVerCombo).attr('disabled', 'disabled');	
	if (idResTypeCombo != null) {
		$("#" + idResTypeCombo).attr('disabled', 'disabled');	
	}
	
	// ///////////////////////////////////////////////////////////////////
	// PUBLIC FUNCTIONS
	// ///////////////////////////////////////////////////////////////////
	
	/**
	 * 
	 * @param idCombo
	 */
	this.handleOnChange = function(idCombo) {

		// Hide button.
		if (idButton != null) {
			$('#' + idButton).hide("slow");
		}
		
		//
		if (idCombo == this.idLangCombo) {

			// Get the selected value in the language combo.
			var lang = $("#" + idLangCombo).val();
						
			// Set option text color.
			disableCombo(idLibCombo);
			disableCombo(idLibVerCombo);
			if (idResTypeCombo != null) {
				disableCombo(idResTypeCombo);
			}
			
			// Library Type: select the first option.
			if (lang == -1) {
								
				// Set option text color.
				defaultCombo(idLangCombo);
				disableCombo(idLibTypeCombo);
				
				// Update combo values.
				updateCombo(idLibTypeCombo, null, null);
				
			} else {
								
				// Set option text color.
				selectCombo(idLangCombo);
				enableCombo(idLibTypeCombo, "pointer");
				
				// Update combo values.
				updateCombo(idLibTypeCombo, LIBRARY_TYPES, DEFAULT_VALUE_LibraryType);
				
			}
			
			// Reset library.
			updateCombo(idLibCombo, null, null);
			updateCombo(idLibVerCombo, null, null);
			updateCombo(idResTypeCombo, null, null);
			
		} else if (idCombo == idLibTypeCombo) {
						
			// Get the selected value in the language combo.
			var lang = null;
			if (idLangCombo == null) {
				lang = JAVA.value;
			} else {
				lang = $("#" + idLangCombo).val();
			}
			
			// Get the selected value in the library type combo.
			var libType = $("#" + idLibTypeCombo).val();

			// Set option text color.
			$("#" + idLibTypeCombo).attr('disabled', false);
			disableCombo(idLibVerCombo);
			if (idResTypeCombo != null) {
				disableCombo(idResTypeCombo);
			}
			
			//
			if (libType == -1) {				
				
				// Enable/disable and set option text color.
				defaultCombo(idLibTypeCombo);
				disableCombo(idLibCombo);
				
				// Reset library.
				updateCombo(idLibCombo, null, null);
				
			} else { 

				// Set option text color.
				selectCombo(idLibTypeCombo);
				enableCombo(idLibCombo, "wait");
				
				// Show loading message.
				updateCombo(idLibCombo, null, DEFAULT_VALUE_Loading);
				
				// Call server.
				$.getJSON(createResourceQuery(lang, libType, -1), null, function(json) {
						updateCombo(idLibCombo, json, DEFAULT_VALUE_Library);
						$("#" + idLibCombo).css({cursor: "pointer"});
					});	
				
			}	
			
			// Reset library version.
			updateCombo(idLibVerCombo, null, null);
			updateCombo(idResTypeCombo, null, null);
			
		} else if (idCombo == this.idLibCombo) {
		
			// Get the selected value in the language combo.
			var lang = null;
			if (idLangCombo == null) {
				lang = JAVA.value;
			} else {
				lang = $("#" + idLangCombo).val();
			}
			
			// Get the selected value in the library type combo.
			var libType = $("#" + idLibTypeCombo).val();

			// Get the selected value in the library combo.
			var lib = $("#" + idLibCombo).val();
			
			//
			$("#" + idLibCombo).attr('disabled', false);
			if (idResTypeCombo != null) {
				disableCombo(idResTypeCombo);
			}
						
			// 
			if (lib == -1) {
				
				// Set option text color.
				$("#" + idLibCombo).css({color: TEXT_COLOR_Default, cursor: "default"});
				disableCombo(idLibVerCombo);
				
				// Update combo values.
				updateCombo(idLibVerCombo, null, null);
				
			} else {

				// Set option text color.
				selectCombo(idLibCombo);
				enableCombo(idLibVerCombo, "wait");

				// Show loading message.
				updateCombo(idLibVerCombo, null, DEFAULT_VALUE_Loading);
				
				// Call server.
				$.getJSON(createResourceQuery(lang, libType, lib), null, function(json) {
					updateCombo(idLibVerCombo, json, DEFAULT_VALUE_LibraryVersion);
					$("#" + idLibVerCombo).css({cursor: "pointer"});
				});
				
			}		
			
			//
			updateCombo(idResTypeCombo, null, null);
			
		} else if (idCombo == this.idLibVerCombo) {

			// Get the selected value in the library version combo.
			var libVer = $("#" + idLibVerCombo).val();
			
			// 
			if (libVer == -1) {
				
				//
				defaultCombo(idLibVerCombo);
				if (idResTypeCombo != null) {
					disableCombo(idResTypeCombo);
					updateCombo(idResTypeCombo, null, null);
				}
				
				//
				if (idButton != null) {
					$('#' + idButton).click(null);
				}
				
			} else {	
				if (idResTypeCombo != null) {
					
					// Enable combo.
					enableCombo(idResTypeCombo, "pointer");
					
					//
					updateCombo(idResTypeCombo, RESOURCE_TYPES, DEFAULT_VALUE_ResourceType);
					
				} else {				

					// Get the selected value in the library combo.
					var lib = $("#" + idLibCombo).val();
					
					// Update option color.
					selectCombo(idLibVerCombo);
					
					//
					if (idButton != null) {
					
						// Show button.
						$('#' + idButton).show("slow");
						
						//
						$('#' + idButton).attr('href', createDownloadQuery(lib, libVer));
					
					}
				
				}				
			}				
			
		} else if (idCombo == this.idResTypeCombo) {

			// Get the selected value in the resource type combo.
			var resType = $("#" + idResTypeCombo).val();
			
			// 
			if ((resType == -1) && (idButton != null)){				
				$('#' + idButton).click(null);				
			} else {				

				// Get the selected value in the language combo.
				var lang = null;
				if (idLangCombo == null) {
					lang = JAVA.value;
				} else {
					lang = $("#" + idLangCombo).val();
				}				
				
				// Get the selected value in the library combo.
				var lib = $("#" + idLibCombo).val();				

				// Get the selected value in the library version combo.
				var libVer = $("#" + idLibVerCombo).val();
				
				// Update option color.
				selectCombo(idResTypeCombo);
				
				//
				if (idButton != null) {
				
					// Show button.
					$('#' + idButton).show("slow");
					
					// Set URL at href.
					$('#' + idButton).attr('href', createViewResourceQuery(lang, lib, libVer, resType));
				
				}
				
			}				
			
		}		
	};
	
	// ///////////////////////////////////////////////////////////////////
	// PRIVATE FUNCTIONS
	// ///////////////////////////////////////////////////////////////////

	/**
	 * 
	 * @param id
	 * @param values
	 * @param defaultValue
	 */
	function updateCombo(id, values, defaultValue) {
			
		// Remove every option from the combo.
		$("#" + id).empty();
		
		// Set default value.
		if (defaultValue != null) {
			$("#" + id).append("<option value='-1' style='color: #89b3b0'>" + defaultValue + "</option>");
		}
		
		// Set each option in the combo.
		if ((values != null) && (values.length > 0)) {
			for (var i = 0; i < values.length; i = i + 1) {
				$("#" + id).append("<option value='" + values[i].value + "'>" + values[i].text + "</option>");
			}
		}
		
	}

	/**
	 * 
	 * @param lang
	 * @param libType
	 * @param lib
	 * @returns
	 */
	function createResourceQuery(lang, libType, lib){
		var t = CONTEXT_PATH + RESOURCE_URL + "?";
		if (lang != -1) {
			t = t + RESOURCE_PARAM_Lan + "=" + lang + "&";
		}
		if (libType != -1) {
			t = t + RESOURCE_PARAM_LibType + "=" + libType + "&";
		}
		if (lib != -1) {
			t = t + RESOURCE_PARAM_Lib + "=" + lib + "&";
		}
		if ((exclude != null) && (exclude)) {
			t = t + RESOURCE_PARAM_Excl + "=true&";
		}
		return t.substring(0, t.length - 1);
	}
	
	/**
	 * 
	 * @param lang
	 * @param lib
	 * @param libver
	 * @returns {String}
	 */
	function createDownloadQuery(lib, libver){
		return CONTEXT_PATH + DOWNLOAD_LIB_URL + "?" + DOWNLOAD_LIB_PARAM_Lib + "=" + lib + "&" + DOWNLOAD_LIB_PARAM_Ver + "=" + libver;
	}
	
	/**
	 * 
	 * @param lang
	 * @param lib
	 * @param libver
	 * @param resType
	 * @returns {String}
	 */
	function createViewResourceQuery(lang, lib, libver, resType){
		if (resType == USER_MANUAL.value) {
			return USER_MANUAL.url + "/" + getLanguage(lang).acronym + "/" + getArtifactId(lib) + "/" + getArtifactId(lib) + "-" + libver + ".pdf";
		} else if (resType == CHANGE_LOG.value) {
			return CHANGE_LOG.url + "/" + getLanguage(lang).acronym + "/" + getArtifactId(lib) + ".txt";
		} else if (resType == API.value) {
			return API.url + "/" + getLanguage(lang).acronym + "/" + getArtifactId(lib) + "/" + libver + "/index.html";
		} else {
			return ONLINE_TUTORIAL.url + "/" + getLanguage(lang).acronym + "/" + getArtifactId(lib) + "/" + libver + "/index.html";
		}
	}
	
	/**
	 * 
	 * @param id
	 */
	function disableCombo(id) {
		$("#" + id).css({color: TEXT_COLOR_Default, cursor: "default"});				
		$("#" + id).attr('disabled', 'disabled');
	}

	/**
	 * 
	 * @param id
	 * @param cursor
	 */
	function enableCombo(id, cursor) {
		$("#" + id).css({color: TEXT_COLOR_Default, cursor: cursor});				
		$("#" + id).attr('disabled', false);
	}
	
	/**
	 * 
	 * @param id
	 */
	function selectCombo(id) {
		$("#" + id).css({color: TEXT_COLOR_Selected, cursor: "pointer"});
	}	
	
	/**
	 * 
	 * @param id
	 */
	function defaultCombo(id) {
		$("#" + id).css({color: TEXT_COLOR_Default, cursor: "pointer"});
	}
	
};

// ///////////////////////////////////////////////////////////////////

/**
 * 
 * @param id
 * @returns
 */
function getLanguage(id) {	
	
	//
	if (id == JAVA.value) {
		return JAVA;
	}
	
	//
	for (var i = 0; i < LANGUAGES.length; i = i + 1) {
		
		//
		var lang = LANGUAGES[i];
		
		//
		if (lang.value == id) {
			return lang;
		}
		
	}
	
	// At this point, nothing to return.
	return null;
	
}

/**
 * 
 * @param id
 * @returns
 */
function getArtifactId(id) {
	return id.substring(id.lastIndexOf('.') + 1, id.length);	
}

// ///////////////////////////////////////////////////////////////////

/**
 * 
 * @param {Object}
 *            target
 */
function redirect(target) {
	var form = getFormByName("DEFAULT_FORM");
	form.action = target;
	form.method = "POST";
	form.submit();
}

/**
 * 
 * @param {Object}
 *            formName
 * @return {TypeName}
 */
function getFormByName(formName) {
	for ( var i = 0; i < document.forms.length; i = i + 1) {
		if ((document.forms[i] != null) && (document.forms[i].name == formName)) {
			return document.forms[i];
		}
	}
	return null;
}

/**
 * 
 * @param lib
 * @param ver
 */
function downloadLib(lib, ver) {
	
	//
	if ($("#dwnLibLib").length > 0){
		$('#dwnLibLib').remove();
	}
	
	//
	if ($("#dwnLibVer").length > 0){
		$('#dwnLibVer').remove();
	}
	
	//
	$('#DEFAULT_FORM').append("<input id='dwnLibLib' type='hidden' name='" + DOWNLOAD_LIB_PARAM_Lib + "' value='" + lib + "'/>");
	$('#DEFAULT_FORM').append("<input id='dwnLibVer' type='hidden' name='" + DOWNLOAD_LIB_PARAM_Ver + "' value='" + ver + "'/>");
	
	//
	var form = getFormByName("DEFAULT_FORM");
	
	//
	form.action = CONTEXT_PATH + DOWNLOAD_LIB_URL;
	form.method = "GET";
	
	//
	form.submit();
	
}

/**
 * http://forums.mozillazine.org/viewtopic.php?f=38&t=549571
 * http://stackoverflow.com/questions/6844595/event-firing-twice-in-ie-onclick-and-onsubmit
 * @param e
 */
function crossbrowser_stopPropagation(e){
	
	//
	if (!e) {
		e = window.event; 
	}
	
	// Setting the cancelBubble property in browsers that don’t support it doesn’t 
	// hurt. The browser shrugs and creates the property. Of course it doesn’t 
	// actually cancel the bubbling, but the assignment itself is safe.
	e.cancelBubble = true; 
	
	//
	if (e.stopPropagation) {
		e.stopPropagation(); 
	}
	
}

