/**
 * 
 * @param id
 * @param def
 *            Default text.
 */
function onInput(id, def) {
	
	//
	var text =  $('#' + id).val();
	
	//
	if (text == def){
		$('#' + id).css({color: TEXT_COLOR_Selected});
		$('#' + id).val('');
	}
	
}

/**
 * 
 * @param id
 * @param def
 *            Default text.
 */
function updateInput(id, def) {
	
	//
	var text =  $('#' + id).val();
	
	//
	if ((text == null) || (text == '')){
		$('#' + id).css({color: TEXT_COLOR_Default});
		$('#' + id).val(def);
	} else if (text == def){
		$('#' + id).css({color: TEXT_COLOR_Selected});
	} else {
		$('#' + id).css({color: TEXT_COLOR_Selected});
	}	
	
}

