/**
 * 
 * @param id
 * @param url
 */
function updateTextArea(id, url) {
	$.jsonp({
		url: url,
		success: function(d) {
        	$('#' + id).val(d.text);
		},
		beforeSend: function(o){
        	$('#' + id).val('Loading...');
        },
		error: function(d, msg) {
			if (confirm("Oops!, we can't find requested file. Lets try again?")) {
				updateTextArea(id, url);
			} 
		}
	});
}

/**
 * 
 * @param cmbLang
 * @param cmbLibType
 * @param cmbLib
 * @param cmbLibVer
 * @param bugRep
 * @param bugTitle
 * @param bugDesc
 * @param submitReport
 * @param submitResume
 * @param submitOptional
 * @param submitBtn
 */
function submitBug(cmbLang, cmbLibType, cmbLib, cmbLibVer, bugRep, bugTitle, bugDesc, submitReport, submitResume, submitOptional, submitBtn){
	
	//
	var lang = null;
	if (cmbLang != null) {
		lang = $('#' + cmbLang).val();
	}
	var libType = $('#' + cmbLibType).val();
	var lib = $('#' + cmbLib).val();
	var libVer = $('#' + cmbLibVer).val();
	var title = $('#' + bugTitle).val();
	var desc = $('#' + bugDesc).val();
	var rep = $('#' + bugRep).val();
		
	//
	var fail = false;
	if (cmbLang != null){
		if ((lang == '-1') || (libType == '-1') || (lib == '-1') || (libVer == '-1') || (title == DEFAULT_VALUE_BugTitle) || (desc == DEFAULT_VALUE_BugDescription)) {
			fail = true;
		}
	} else {
		if ((libType == '-1') || (lib == '-1') || (libVer == '-1') || (title == DEFAULT_VALUE_BugTitle) || (desc == DEFAULT_VALUE_BugDescription)) {
			fail = true;
		}
	}
		
	//
	if (fail) {
		$('#' + submitReport).text('Before submit, please fill every field in the form');
	} else {
		$.ajax({
	        url: createBugReportQuery(lib, libVer, title, desc, rep),
	        type: "POST",
	        dataType: "text",
	        beforeSend: function(o){
	        	
	        	// Display wait message. 
	        	$('#' + submitReport).text('Submitting bug, please wait...');	        	
	        	
	        	// Disable inputs.
	        	updateBugInputs(false, cmbLang, cmbLibType, cmbLib, cmbLibVer, bugTitle, bugDesc, bugRep);	        	

	    		// Hide button.
	    		$('#' + submitBtn).hide();
	        	
	        },
	        error: function(jq, ts, err) {

	        	//
	        	bugError(submitReport, submitBtn);	 
	        	
	        	//
	        	updateBugInputs(true, cmbLang, cmbLibType, cmbLib, cmbLibVer, bugTitle, bugDesc, bugRep);        	       	
	        	
	        },
	        success: function(d){
	        	if (d >= 0) {	    
	        		
		        	//
		        	$('#' + submitReport).text('Bug submitted successfully!!');
		        	
		        	// Disable inputs.
		        	if (cmbLang != null) {
		        		$('#' + cmbLang).hide();
		        	}
		        	$('#' + cmbLibType).hide();
		        	$('#' + cmbLib).hide();
		        	$('#' + cmbLibVer).hide();
		        	$('#' + bugTitle).hide();
		        	$('#' + bugDesc).hide();
		        	$('#' + bugRep).hide();
		        	$('#' + submitOptional).hide();        	
		        	
		        	//
		        	var lanAcr = null;
		        	if (getLanguage(lang) != null) {
		        		lanAcr = getLanguage(lang).acronym;
		        	} else {
		        		lanAcr = JAVA.acronym;
		        	}
		        	
		        	//
		        	$('#' + submitResume).append(bugResume(d, lanAcr));
	        	
	        	} else {
	        		
	        		//
	        		bugError(submitReport, submitBtn);
	        		
		        	//
		        	updateBugInputs(true, cmbLang, cmbLibType, cmbLib, cmbLibVer, bugTitle, bugDesc, bugRep);
		        	
	        	}	        	
	        }
		});	
	}
	
}

/**
 * 
 * @param lang
 * @param lib
 * @param libVer
 * @param bugRep
 * @param bugTitle
 * @param bugDesc
 * @param submitReport
 * @param submitResume
 * @param submitOptional
 * @param submitBtn
 */
function submitLibBug(lang, lib, libVer, bugRep, bugTitle, bugDesc, submitReport, submitResume, submitOptional, submitBtn){
	
	//	
	var title = $('#' + bugTitle).val();
	var desc = $('#' + bugDesc).val();
	var rep = $('#' + bugRep).val();
		
	//
	var fail = false;	
	if ((title == DEFAULT_VALUE_BugTitle) || (desc == DEFAULT_VALUE_BugDescription)) {
		fail = true;
	}	
		
	//
	if (fail) {
		$('#' + submitReport).text('Before submit, please fill every field in the form');
	} else {
		$.ajax({
	        url: createBugReportQuery(lib, libVer, title, desc, rep),
	        type: "POST",
	        dataType: "text",
	        beforeSend: function(o){
	        	
	        	// Display wait message. 
	        	$('#' + submitReport).text('Submitting bug, please wait...');	        	
	        	
	        	// Disable inputs.	        	
	        	updateBugInputs(false, null, null, null, null, bugTitle, bugDesc, bugRep);

	    		// Hide button.
	    		$('#' + submitBtn).hide();
	        	
	        },
	        error: function(jq, ts, err) {
	        	
	        	//
	        	bugError(submitReport, submitBtn);

	        	//
	        	updateBugInputs(true, null, null, null, null, bugTitle, bugDesc, bugRep);
	        	
	        },
	        success: function(d){
	        	if (d >= 0) {
	        	
		        	//
		        	$('#' + submitReport).text('Bug submitted successfully!!');
		        		        	
		        	// Disable inputs.		        	
		        	$('#' + bugTitle).hide();
		        	$('#' + bugDesc).hide();
		        	$('#' + bugRep).hide();
		        	$('#' + submitOptional).hide();        	
		        		        	
		        	//
		        	$('#' + submitResume).append(bugResume(d, lang));
	        	
	        	} else {
	        		
	        		//
	        		bugError(submitReport, submitBtn);

		        	//
		        	updateBugInputs(true, null, null, null, null, bugTitle, bugDesc, bugRep);
		        	
	        	}	        	
	        }
		});	
	}
	
}

/**
 * 
 * @param id
 * @param lang
 * @returns {String}
 */
function bugResume(id, lang) {
	
	//
	if (lang == null) {
		lang = JAVA.acronym; 
	}
	
	//
	return "<b>Thank you very much for reporting a failure</b>. If you plan to track this bug, please read the following information:" +
		"<div style='display: block; height: 35px;'></div>" +	
		"<ul class='text_style_13 list_style_1'>" +	
		"<li>Your bug identification number is <b>#" + id + "</b>.<br><br></li>" +
		"<li>" +
		"Follow this bug <a href='" + (TRACK_BUG_URL + "-" + lang + "/ticket/" + id) + "' target='_blank' class='text_link'>here</a><br><br>" +
		"</li>" +
		"<li>" +
		"Once the bug is fixed, you will be notified about this on <a href='http://twitter.com/#!/" + TWITTER_USER + "' target='_blank' class='text_link'>Twitter</a>.<br><br>" +
		"</li>" +	        	
		"<li>" +
		"More bug reports can be found <a href='" + TRACK_BUG_URL + "-" + lang + "/report#' class='text_link' target='_blank'>here</a>." +
		"</li>" +
		"</ul>"; 
	
}

/**
 * 
 * @param rep
 * @param btn
 */
function bugError(rep, btn) {
	
	// Display wait message. 
	$('#' + rep).text('Oops!, something went wrong, try again...');
	
	// 
	$('#' + btn).show();
	
}

/**
 * 
 * @param enabled
 * @param cmbLang
 * @param cmbLibType
 * @param cmbLib
 * @param cmbLibVer
 * @param bugTitle
 * @param bugDesc
 * @param bugRep
 */
function updateBugInputs(enabled, cmbLang, cmbLibType, cmbLib, cmbLibVer, bugTitle, bugDesc, bugRep){
	
	//
	var v;
	if (enabled)
		v = false;
	else 
		v = 'disabled';	
	
	// Disable inputs.
	if (cmbLang != null)		
		$('#' + cmbLang).attr('disabled', v);
	if (cmbLibType != null) 
		$('#' + cmbLibType).attr('disabled', v);
	if (cmbLib != null) 
		$('#' + cmbLib).attr('disabled', v);
	if (cmbLibVer != null) 
		$('#' + cmbLibVer).attr('disabled', v);
	if (bugTitle != null) 
		$('#' + bugTitle).attr('disabled', v);
	if (bugDesc != null) 
		$('#' + bugDesc).attr('disabled', v);
	if (bugRep != null) 
		$('#' + bugRep).attr('disabled', v);
	
}

/**
 * 
 * @param lib
 * @param ver
 * @param tit
 * @param des
 * @param rep
 * @returns {String}
 */
function createBugReportQuery(lib, ver, tit, des, rep) {
	
	//
	var url = CONTEXT_PATH + BUG_REPORT_URL + "?" + 
		BUG_REPORT_PARAM_Lib + "=" + lib + "&" + 
		BUG_REPORT_PARAM_LibVer + "=" + ver + "&" + 
		BUG_REPORT_PARAM_Tit + "=" + tit + "&" + 
		BUG_REPORT_PARAM_Desc + "=" + des;
	
	//
	if (rep != DEFAULT_VALUE_BugReporter) {
		url = url + "&" + BUG_REPORT_PARAM_Rep + "=" + rep;
	}
	
	//
	return url;
	
}

