/**
 * 
 * @param id
 */
function requestFAQ(id) {	
	$.jsonp({
		"url": FAQ_URL + "/" + id + ".faq",
		"success": parseFAQ,
		"error": function(d, msg) {          
			if (confirm("Oops!, we can't find requested file. Lets try again?")) {
				requestFAQ(id);
			} else {
				redirect(DOCUMENTATION_PAGE);
			} 
		}
	});		
}

/**
 * 
 * @param data
 */
function parseFAQ(faqs) {	
	if (faqs != null) {
		for (var i = 0; i < faqs.length; i = i + 1) {
			
			//
			var faq = faqs[i];
			
			//
			$("#faqs").append("<li><b>" + faq.question + "</b><br><br>" + faq.answer);			
		
			//
			if (i < (faqs.length - 1)) {
				$("#faqs").append("<br><br>");	
			}
			
			//
			$("#faqs").append("</li>");
			
		}
	} 
}

/**
 * 
 */
function requestHeader() {	
	$.jsonp({
		"url": RESOURCES_PORTAL_WEB_URL + "/layout/head.jsonp",
		"success": function(d) {
			$("#layout_head_menu").append(d.html);
		},
		"error": function(d, msg) {          
			if (confirm("Oops!, we can't find requested file. Lets try again?")) {
				requestHeader();
			}
		}
	});		
}

/**
 * 
 */
function requestFooter() {	
	$.jsonp({
		"url": RESOURCES_PORTAL_WEB_URL + "/layout/footer.jsonp",
		"success": function(d) {
			$("#layout_footer").append(d.html);
		},
		"error": function(d, msg) {          
			if (confirm("Oops!, we can't find requested file. Lets try again?")) {
				requestHeader();
			}
		}
	});		
}

